document.querySelector('.scroll_top').addEventListener('click',()=>{
  document.querySelector('.amazon').scrollTop=0;
})
document.querySelector('.scroll_top_display').addEventListener('click',()=>{
  document.querySelector('.display_img_container').scrollTop=0;
})
document.querySelector('.scroll_top_privancy_notice').addEventListener('click',()=>{
  document.querySelector('.privancy_notice').scrollTop=0;
})
setInterval(()=>{
  let scrolling_display=document.querySelector('.display_img_container').scrollTop;
  let scrolling_privancy_notice=document.querySelector('.privancy_notice').scrollTop;
  let scrolling_amazon=document.querySelector('.amazon').scrollTop;
  //scrolling_amazon
  if(scrolling_amazon===0){
    // logo
    document.querySelector('.amazon-header-left-section').style.display='block';
    //search
    document.querySelector('.hidden_seach_when_enter_order').style.display='block';
    //return order && cart
    document.querySelector('.amazon-header-right-section').style.display='flex';

    //amazon-header height: 60px to 0px
    document.querySelector('.amazon-header').style.height='60px';
    document.querySelector('.scroll_top').style.display='none';
    if(document.querySelector('.amazon-header').dataset.whichPage==='empty'){
      document.querySelector('.amazon-header').dataset.whichPage='logo_page';
    }
  }else{
  // logo
  document.querySelector('.amazon-header-left-section').style.display='none';
  //search
  document.querySelector('.hidden_seach_when_enter_order').style.display='none';
  //return order && cart
  document.querySelector('.amazon-header-right-section').style.display='none';

  //amazon-header height: 60px to 0px
  document.querySelector('.amazon-header').style.height='0px';
  document.querySelector('.amazon-header').style.paddingTop='0px';
  document.querySelector('.amazon-header').style.paddingBottom='0px';

  //
  document.querySelector('.scroll_top').style.display='block';
  document.querySelector('.amazon').style.marginTop='20px';

  
  if(document.querySelector('.amazon-header').dataset.whichPage==='logo_page'){
    document.querySelector('.amazon-header').dataset.whichPage='empty';
  }
  
  }
  //scrolling_display
  if(scrolling_display===0){
    document.querySelector('.scroll_top_display').style.display='none';
  }else{
    document.querySelector('.scroll_top_display').style.display='block';
  }
  //scroll_top_privancy_notice
  if(scrolling_privancy_notice===0){
    document.querySelector('.scroll_top_privancy_notice').style.display='none';
  }else{
    document.querySelector('.scroll_top_privancy_notice').style.display='block';
  }
},500)
setInterval(()=>{
  let dataDashed=document.querySelector('.amazon-header').dataset.whichPage;
  if(dataDashed==='empty'){
    document.querySelector('.display_img_container').style.top='28px';
    document.querySelector('.poster_diplay_container').style.marginTop='-50px';
  }else if(dataDashed==='logo_page' && screen.width<490){
    document.querySelector('.amazon-header').style.paddingTop='30px';
    document.querySelector('.amazon-header').style.paddingBottom='80px';
    //
    document.querySelector('.search-shows-div').style.top='110px';
    document.querySelector('.poster_diplay_container').style.marginTop='50px';
    document.querySelector('.display_img_container').style.top='140px';
  }else if(dataDashed==='order_page' && screen.width<490){
    document.querySelector('.amazon-header').style.paddingTop='0px';
    document.querySelector('.amazon-header').style.paddingBottom='0px';

  }else if(dataDashed==='checkout_page' && screen.width<490){
    document.querySelector('.amazon-header').style.paddingTop='30px';
    document.querySelector('.amazon-header').style.paddingBottom='80px';
  }else{
    document.querySelector('.amazon-header').style.paddingTop='0px';
    document.querySelector('.amazon-header').style.paddingBottom='0px';
    
    document.querySelector('.poster_diplay_container').style.marginTop='5px';
    
    if(dataDashed==='order_page'){
      document.querySelector('.display_img_container').style.top='60px';
    }else{
      document.querySelector('.display_img_container').style.top='90px';
    }
  }

  if(screen.width<490){
    document.querySelector('.search-shows-div').style.top='110px';
  }else{
    document.querySelector('.search-shows-div').style.top='60px';
  }
},500)
