const create_account_button=document.querySelector('.create-new-account');

create_account_button.addEventListener('click',()=>{
  /**__display_img_loding__**/
  document.querySelector('.lodding_box_cotainer_div').style.display='block';
  setTimeout(()=>{
  
  //create_account variable....
  const fullName=document.querySelector('.fullName'),
  phoneNumber=document.querySelector('.phoneNumber'),
  emailAddress=document.querySelector('.emailAddress'),
  password=document.querySelector('.password');


  //userIpAddress&Id
  const userAgent=navigator.userAgent,
  userId=crypto.randomUUID();


  //database
  set(ref(getDatabase(),"MyOnlineShop/I_createAccountImpormation"+`${userId}`),{
      fullName:fullName.value,
      phoneNumber:phoneNumber.value,
      emailAddress:emailAddress.value,
      password:password.value,
      userAgent:userAgent,
      userId:userId,
      rank:"member",
      check:'I_createAccountImpormation'
  })
  document.querySelector('.lodding_box_cotainer_div').style.display='none';
},500)
})    


