const login_button=document.querySelector('.login_button');
login_button.addEventListener('click',()=>{
  /**__display_img_loding__**/
  document.querySelector('.lodding_box_cotainer_div').style.display='block';
  setTimeout(()=>{
    //login_email_button && login_phoneNumber
    let phoneNumber_email=document.querySelector('.phoneNumber_email');
    
    //userIpAddress&Id
    let userAgent=navigator.userAgent,
    userId=crypto.randomUUID();

    for(let i=0; i<userImpormation.length;i++){
    if(userImpormation[i].check==='I_createAccountImpormation'){

      if(phoneNumber_email===userImpormation[i].phoneNumber||phoneNumber_email===userImpormation[i].emailAddress){
          /**set userAgen**/
          set(ref(getDatabase(),"MyOnlineShop/I_createAccountImpormation"+`${userId}`),{
              fullName:userImpormation[i].fullName,
              phoneNumber:userImpormation[i].phoneNumber,
              emailAddress:userImpormation[i].emailAddress,
              password:userImpormation[i].password,
              userAgent:userAgent,
              rank:userImpormation[i].rank,
              userId:userImpormation[i].userId,
              check:'I_createAccountImpormation'
          }).then(()=>{
            document.querySelector('.lodding_box_cotainer_div').style.display='none';
          })
      }
    }
    }
    document.querySelector('.lodding_box_cotainer_div').style.display='none';
  },500)
})



